import React from 'react';
import { Switch, Route } from 'react-router-dom'
import logo from './assets/logo.png'
import Navbar from './components/Navbar.js'
import Auth from './components/Auth.js'
//import Profile from './components/Profile.js'
//import Public from './components/Public.js'

function App() {
  return (
    <div className="App">
      <div className="title-holder"><img src={logo} alt="Ann's Kitty-love logo" />
    <h1>Rate the Review</h1></div>
    <Navbar />

    <Switch >

      <Route exact path="/">
        <Auth />
      </Route>

      <Route path="/profile">
        {/* <Profile /> */} Profiel Page goes here
      </Route>

      <Route path="/public">
        {/* <Public /> */} Publick page goes here
      </Route>

    </Switch>
    </div>
  );
}

export default App;
